import './SideNavigation.css';

const SideNavigation = () => {
    return (
        <div className="sidebar">
            {/* Add your navigation items here */}
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </div>
    );
};

export default SideNavigation;
